        uint256 tokenId = _tokenIds.current();
        _tokenIds.increment();

        asset storage newAsset = _tokenURIs[tokenId];

        _owners[tokenId] = msg.sender;
        _balances[to] += 1;
        _myAllTokenIds[to].push(tokenId);

        _setTokenURI(tokenId, newAsset, ipfsHash);
        _tokenIdList.push(tokenId);
